import './index.css'
import { departments } from './vendor/constants';
import Card from './components/Card';
import Department from './components/Department';

function App() {

  return (
   <div className='page'>
    <div className='content'>
      {departments.map((department) => {
        return (
          <Card title={department}/>
        )
      })}
    </div>

   </div>
  );
}

export default App;
